import React from 'react';
import "../assets/css/galeria.css";
import { useImagen } from '../context/ImagenContext';
import Heart from "../component/Heart";

function GaleriaImagenes() {
  const { imagenes } = useImagen();
  return (
    <div className="galeria">
    {imagenes.map((imagen) => (
      <div className="galeria grid-columns-5 p-3 imagen-container" key={imagen.id}>
        <img src={imagen.src.original} alt={imagen.alt}  className="foto imagen" />
        <Heart />
      </div>
    ))}
    </div>
  );
}

export default GaleriaImagenes;
